	(0, 'Upload Primary Picture', '', '', 'N', 12, '', 'N', 'N'),
	(1, 'Email Validation', 'questions/validate_q.php', '', 'N', 2, '', 'N', 'N'),
	(2, 'Personal', 'questions/profile_q.php', 'http://www.youtube.com/v/EdBWl1Bzuio', 'Y', 3, '', 'N', 'N'),
	(3, 'Professional', 'questions/professional_q.php', '', 'Y', 4, '', 'N', 'N'),
	(4, 'Personality', 'questions/questionnaire.php', 'http://www.youtube.com/v/8y5-4HgE7W4', 'N', 5, 'Emotional traits correlate highly with interpersonal relationship strength and longevity. Display your emotional traits through answering all the fields below. Please ensure all information provided is accurate for a more compatible match.', 'N', 'Y'),
	(5, 'Indoor Life', 'questions/questionnaire.php', 'http://www.youtube.com/v/8y5-4HgE7W4', 'N', 6, 'Rutger\'s University presented in their "State of our Unions" pointed to compatibility in spirituality being essential to a successful relationship. Ensure that you are matched with your spiritual mate by completing the fields below truthfully. Please ensure all information provided is accurate for a more compatible match.', 'Y', 'Y'),
	(6, 'Outdoor Life', 'questions/questionnaire.php', 'http://www.youtube.com/v/8y5-4HgE7W4', 'N', 7, 'How you spend your leisure time has a lot to do with the success of your relationship. You have a lot more in common when you like to do similar activities in your spare time. Please ensure all information provided is accurate for a more compatible match.', 'Y', 'Y'),
	(7, 'Family', 'questions/questionnaire.php', 'http://www.youtube.com/v/8y5-4HgE7W4', 'N', 8, 'How you were brought up and how you plan on living your family life is essential in finding a spouse. The foundation of the family starts from the Husband and Wife and therefore its essential in finding a compatible partner that both of you feel the same ideologically about family life. Please ensure all information provided is accurate for a more compatible match.', 'Y', 'Y'),
	(8, 'Spritual', 'questions/questionnaire.php', 'http://www.youtube.com/v/8y5-4HgE7W4', 'N', 9, 'It is not about how you look but rather how you feel you look. Studies have shown that people perceive their appearance a certain way and it actually affects relationships. Therefore we have taken this into account to find more compatible matches so suspicions and inferiority complexes can be avoided that lead to many relationship problems. Please ensure all information provided is accurate for a more compatible match.', 'Y', 'Y'),
	(9, 'Appearance', '', '', 'N', 10, '', 'Y', 'Y'),
	(10, 'Professional', '', '', 'N', 11, '', 'Y', 'Y'),
